import React, {Component} from 'react';
import {Link} from "react-router-dom";

class Navbar extends Component {
    onHandleClick(e) {
        e.preventDefault();
       this.props.history.push("/portfolio")
    }

    render() {
        return (
            <>
                <nav className="navbar fixed-bottom navbar-expand-lg navbar-light bg-transparent">
                    <div className="container">
                        <button className="navbar-toggler" type="button" data-toggle="collapse"
                                data-target="#navbarSupportedContent"
                                aria-controls="navbarSupportedContent" aria-expanded="false"
                                aria-label="Toggle navigation">
                            <span className="navbar-toggler-icon"/>
                        </button>
                        <div className="collapse navbar-collapse" id="navbarSupportedContent">
                            <ul className="navbar-nav mr-auto">
                                <li className="nav-item">
                                    <Link onClick={(e) => this.onHandleClick(e)} className="nav-link"
                                          to="./">Home</Link>
                                </li>
                                <li className="nav-item">
                                    <Link onClick={(e) => this.onHandleClick(e)} className="nav-link"
                                          to='/portfolio'>Portfolio</Link>
                                </li>
                                <li className="nav-item">
                                    <Link to='contact' onClick={(e) => this.onHandleClick(e)} className="nav-link">contact
                                        me</Link>
                                </li>
                            </ul>
                        </div>
                    </div>
                </nav>
            </>
        );
    }
}

export default Navbar;
